  (EA) is to evaluate the hunting program onArapaho National Wildlife Refuge (NWR).
  This EA, and hunting plan that will result, will address only hunting.  Arapaho
  NWR defines a quality hunt as the opportunity for a hunter to get away from their
  vehicle and use foot pursuit of game, have limited contact with other hunters, and
  minimize thechance of disturbance by other refuge visitors.\",\n\t\"license_title\":
